CREATE TABLE IF NOT EXISTS  `{project}.{dest_dataset}.ReportInfo`
(	
	ReportID STRING,
	ReportConfidentialStatement STRING,
	ReportFooter STRING,
	ReportLogo BYTES,
	ReportLogoMIMEType STRING
);

MERGE INTO  `{project}.{dest_dataset}.ReportInfo` as Target 
USING (
	
	SELECT '-1' as ReportID
	,'CONFIDENTIALITY NOTICE: The information contained in this report is considered confidential and intended solely for the use of Jewelers Mutual Insurance Group employees and authorized representatives only.  All other uses of this report are prohibited.' as ReportConfidentialStatement
	,'Data Source: [DatabaseServer]\\[DatabaseName]' as ReportFooter
	,b'' as ReportLogo
	,'image/jpeg' as ReportLogoMIMEType UNION ALL
	
	SELECT 'Agent'
	,'CONFIDENTIALITY NOTICE: The information contained in this report is considered confidential and intended solely for the use of Jewelers Mutual Insurance Group employees and authorized representatives only.  All other uses of this report are prohibited.'
	,'Data Source: [DatabaseServer]\\[DatabaseName]'
	,b''
	,'image/jpeg' UNION ALL
	
	SELECT '1060'
	,'CONFIDENTIALITY NOTICE: The information contained in this report is considered confidential and intended solely for the use of Jewelers Mutual Insurance Group employees and authorized representatives only.  All other uses of this report are prohibited.'
	,'Data Source: [DatabaseServer]\\[DatabaseName]'
	,b''
	,'image/jpeg' UNION ALL
	
	SELECT 'test_internal'
	,'CONFIDENTIALITY NOTICE: The information contained in this report is confidential and intended solely for the use of Jewelers Mutual Insurance Group employees. All other uses of this report are prohibited.'
	,'Data Source: [DatabaseServer]\\[DatabaseName]'
	,b''
	,'image/png' UNION ALL

	SELECT 'test_external'
	,'CONFIDENTIALITY NOTICE: This information is published for the internal use and distribution to Jewelers Mutual Insurance Group personnel and authorized representatives only. Distribution or copying of this information by unauthorized persons is strictly prohibited. Please contact the Jewelers Mutual Insurance Group Sales team regarding any questions or concerns.'
	,'Data Source: [DatabaseServer]\\[DatabaseName]'
	,b''
	,'image/png'
)  as Source -- ([ReportID],[ReportConfidentialStatement],[ReportFooter],[ReportLogo],[ReportLogoMIMEType]) 
	ON Target.ReportID = Source.ReportID
WHEN MATCHED THEN 
	UPDATE SET 
	ReportID = Source.ReportID,
	ReportConfidentialStatement = Source.ReportConfidentialStatement,
	ReportFooter = Source.ReportFooter,
	ReportLogo = Source.ReportLogo,
	ReportLogoMIMEType = Source.ReportLogoMIMEType
WHEN NOT MATCHED BY Target THEN 
	INSERT (ReportID
	,ReportConfidentialStatement
	,ReportFooter
	,ReportLogo
	,ReportLogoMIMEType)
	VALUES (ReportID
	,ReportConfidentialStatement
	,ReportFooter
	,ReportLogo
	,ReportLogoMIMEType)
WHEN NOT MATCHED BY Source THEN 
	DELETE;